        #         result.append(0)
        # # print(result)
        # return result

        # 必须要采用这种栈的方法
        length = len(temperatures)
        result = [0] * length
        stack = []
        for i, cur in enumerate(temperatures):
            while stack and cur > temperatures[stack[-1]]:
                orig_index = stack.pop()
                result[orig_index] = i - orig_index
            stack.append(i)
        # print(result)
        return result
